      "iterableToString" : 
        "name" : "iterableToString"
        "qualifiedname" : "dart._collection.dev.ToString.iterableToString"
        "comment" : "<p>Returns a string representing the specified iterable. If the iterable is a <code>List</code>, the returned string looks like this: [:'[element0, element1, ... elementN]':]. The value returned by its <code>toString</code> method is used to represent each element. If the specified iterable is not a list, the returned string looks like this: <code>:{element0, element1, ... elementN}:</code>. In other words, the strings returned for lists are surrounded by square brackets, while the strings returned for other iterables are surrounded by curly braces.</p> <p>If the specified iterable contains a reference to itself, either directly or indirectly through other iterables or maps, the contained reference is rendered as [:'[...]':] if it is a list, or <code>:'{...}':</code> if it is not. This prevents the infinite regress that would otherwise occur. So, for example, calling this method on a list whose sole element is a reference to itself would return <code>:'[[...]]':</code>.</p> <p>A typical implementation of a iterable's <code>toString</code> method will simply return the results of this method applied to the iterable.</p>"
        "type" : "method"
        "static" : "true"
        "return" : "dart.core.String"
        "parameters" : 
          "i" : 
            "name" : "i"
            "qualifiedname" : "dart._collection.dev.ToString.iterableToString#i"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.core.Iterable"
            "value" : "null"
      "_emitValue" : 
        "name" : "_emitValue"
        "qualifiedname" : "dart._collection.dev.ToString._emitValue"
        "comment" : "<p>Appends a string representing the specified iterable to the specified string buffer. The string is formatted as per <code>iterableToString</code>. The <code>:visiting:</code> list contains references to all of the enclosing iterables and maps (which are currently in the process of being emitted into <code>:result:</code>). The <code>:visiting:</code> parameter allows this method to generate a [:'[...]':] or <code>:'{...}':</code> where required. In other words, it allows this method and <code>_emitMap</code> to identify recursive iterables and maps.</p>"
        "type" : "method"
        "static" : "true"
        "return" : "void"
        "parameters" : 
