      "_emitObject" : 
        "name" : "_emitObject"
        "qualifiedname" : "dart._collection.dev.ToString._emitObject"
        "comment" : "<p>Appends a string representing the specified object to the specified string buffer. If the object is a <code>iterable</code> or <code>Map</code>, it is formatted as per <code>iterableToString</code> or <code>mapToString</code>; otherwise, it is formatted by invoking its own <code>toString</code> method.</p> <p>The <code>:visiting:</code> list contains references to all of the enclosing collections and maps (which are currently in the process of being emitted into <code>:result:</code>). The <code>:visiting:</code> parameter allows this method to generate a [:'[...]':] or <code>:'{...}':</code> where required. In other words, it allows this method and <code>_emitCollection</code> to identify recursive maps and collections.</p>"
